import React from 'react';
import { StyledCell } from './styles/styledCell';
import { TETROMINOS } from '../tetrominos';;

const Cell = ({type}) => (
    <StyledCell type={'O'} color={TETROMINOS['O'].color}>cell</StyledCell>
)

export default Cell;
